import React, { Component } from 'react'

export class ChildComponent extends Component {
    constructor(props) {
        super(props)
        console.log("Inside constructor")
        this.state = {
          count: 0,
        }
    }
  render() {
    return (
      <div>ChildComponent</div>
    )
  }
}

export default ChildComponent
